import React from 'react';
import {Link} from 'react-router-dom';
import image1 from '../Assets/image1.png';

function App() {

  return (
    <div className="wrapper">
        <main>
            <h1>Hello</h1>
            <img src={image1} alt="image1"/>
            <p>Catastrophizing refers to when we start imagining the worst case scenarios, when we're met with 
               genuine setbacks.
            </p>
            <Link to = "/ThoughtForm">Continue</Link>
        </main>
    </div>
  );
}

export default App;
